INSERT INTO `email_templates` (`ID`, `title`, `message`, `hook`, `language`) VALUES
(1, 'Forgot Your Password', '<p>Dear [NAME],<br />\r\n<br />\r\nSomeone (hopefully you) requested a password reset at [SITE_URL].<br />\r\n<br />\r\nTo reset your password, please follow the following link: [EMAIL_LINK]<br />\r\n<br />\r\nIf you did not reset your password, please kindly ignore this email.<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'forgot_password', 'english'),
(2, 'Email Activation', '<p>Dear [NAME],<br />\r\n<br />\r\nSomeone (hopefully you) has registered an account on [SITE_NAME] using this email address.<br />\r\n<br />\r\nPlease activate the account by following this link: [EMAIL_LINK]<br />\r\n<br />\r\nIf you did not register an account, please kindly ignore this email.<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'email_activation', 'english'),
(3, 'Support Ticket Reply', '<p>[IMAP_TICKET_REPLY_STRING]<br />\r\n<br />\r\nDear [NAME],<br />\r\n<br />\r\nA new reply was posted on your ticket:<br />\r\n<br />\r\n[TICKET_BODY]<br />\r\n<br />\r\nTicket was generated here: [SITE_URL]<br />\r\n<br />\r\n[IMAP_TICKET_ID] [TICKET_ID]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'ticket_reply', 'english'),
(4, 'Support Ticket Creation', '<p>[IMAP_TICKET_REPLY_STRING]<br />\r\n<br />\r\nDear [NAME],<br />\r\n<br />\r\nThanks for creating a ticket at our site: [SITE_URL]<br />\r\n<br />\r\nYour message:<br />\r\n<br />\r\n[TICKET_BODY]<br />\r\n<br />\r\nWe&#39;ll be in touch shortly.<br />\r\n<br />\r\n[IMAP_TICKET_ID] [TICKET_ID]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'ticket_creation', 'english'),
(5, 'Support Guest Ticket Creation', '<p>[IMAP_TICKET_REPLY_STRING]<br />\r\n<br />\r\nDear [NAME],<br />\r\n<br />\r\nThanks for creating a ticket at our site: [SITE_URL]<br />\r\n<br />\r\nYour message:<br />\r\n<br />\r\n[TICKET_BODY]<br />\r\n<br />\r\nTo view your ticket, use these Guest Login details:<br />\r\nEmail: [GUEST_EMAIL]<br />\r\nPassword: [GUEST_PASS]<br />\r\n<br />\r\nGuests Login Here: [GUEST_LOGIN]<br />\r\n<br />\r\nWe&#39;ll be in touch shortly.<br />\r\n<br />\r\n[IMAP_TICKET_ID] [TICKET_ID]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'guest_ticket_creation', 'english'),
(7, 'Ticket Reminder', '<p>Dear [NAME],<br />\r\n<br />\r\nThis is a reminder that you currently have an open ticket that needs your attention.<br />\r\n<br />\r\nPlease login to your ticket at:<br />\r\n<br />\r\n[SITE_URL]<br />\r\n<br />\r\nEmail Login: [NAME]<br />\r\nTicket Password: [GUEST_PASS]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'ticket_reminder', 'english'),
(8, 'New Notification', 'Dear [NAME],<br /><br />\r\n\r\nYou have a new notification waiting for you at [SITE_NAME]. You can view it by logging into:<br /><br />\r\n\r\n[SITE_URL]<br /><br />\r\n\r\nYours,<br />\r\n[SITE_NAME]', 'new_notification', 'english'),
(9, 'Close Ticket', '<p>Dear [NAME],</p>\r\n\r\n<p>We have just closed your ticket ID&nbsp;[IMAP_TICKET_ID] at [SITE_URL].</p>\r\n\r\n<p>You can view the ticket here: [TICKET_URL].</p>\r\n\r\n<p>If you need anymore assistance, please open a new ticket and we&#39;ll be happy to help.</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>[SITE_NAME]</p>\r\n', 'close_ticket', 'english'),
(10, 'Transfer Access Right Request', '<p>Dear [NAME],<br />\r\n<br />\r\nYou have a form access right request that transfers from user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME]&nbsp;for you to [STATUS]. Thank you.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'transfer_accessright', 'english'),
(12, 'Approve Access Right Request', '<p>Dear [NAME],<br />\r\n<br />\r\nUser [FIRST_NAME] [LAST_NAME] has already approved on your&nbsp;form access right request. Thank You.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_accessright', 'english'),
(13, 'Ticket CC Template', '<p>Dear [NAME],<br />\r\n<br />\r\nYou have a new cc ticket for you at [SITE_NAME]. You can view it by logging into:<br />\r\n<br />\r\n[TICKET_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'ticket_cc', 'english'),
(14, 'Transfer User Move Request', '<p>Dear [NAME],<br />\r\n<br />\r\nYou have a form user move request that transfers from user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME]&nbsp;for you to [STATUS]. Thank you.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'transfer_usermove', 'english'),
(15, 'Approve User Move Request', '<p>Dear [NAME],<br />\r\n<br />\r\nUser [FIRST_NAME] [LAST_NAME] has already approved on your&nbsp;form user move request. Thank You.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_usermove', 'english'),
(16, 'Reject User Move Request', '<p>Dear [NAME],<br />\r\n<br />\r\nUser [FIRST_NAME] [LAST_NAME] has rejected your&nbsp;form user move request. Thank You.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'reject_usermove', 'english'),
(17, 'Reject Access Right Request', '<p>Dear [NAME],<br />\r\n<br />\r\nUser [FIRST_NAME] [LAST_NAME] has rejected your&nbsp;form access right request. Thank You.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'reject_accessright', 'english'),
(18, 'Transfer Loan Application', '<p>Dear [NAME],<br />\r\n<br />\r\nYou got a loan application form&nbsp;that transfers from user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME]&nbsp;for you to [STATUS]. Thank you.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'transfer_loan_application', 'english'),
(19, 'Approve Loan Application', '<p>Dear [NAME],<br />\r\n<br />\r\nUser [FIRST_NAME] [LAST_NAME] has already approved your loan application form. Thank You.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_loan_application', 'english'),
(20, 'Reject Loan Application', '<p>Dear [NAME],<br />\r\n<br />\r\nUser [FIRST_NAME] [LAST_NAME] has rejected your&nbsp;loan application form. Thank You.</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'reject_loan_application', 'english'),
(21, 'Request Float Advance Form', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a Float Advance form that requested by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfer for you to check. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'request_float_advance', 'english'),
(22, 'Check Float Advance Message', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a Float Advance form that checked by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to approve. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'check_float_advance', 'english'),
(23, 'Approve Float Advance Message', '<p>Dear [NAME],</p>\r\n\r\n<p>Your Float Advance form request has already approved. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_float_advance', 'english'),
(24, 'Reject Float Advance Message', '<p>Dear [NAME],</p>\r\n\r\n<p>Your float advance form has been rejected. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'reject_float_advance', 'english'),
(25, 'Request Advance Clearing', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a form advance clearing that requested by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to make settlements. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'request_advance_clearing', 'english'),
(26, 'Settlement Advance Clearing', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a form advance clearing that settled by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to check. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'settlement_advance_clearing', 'english'),
(27, 'Check Advance Clearing', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a form advance clearing that checked by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to verify. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'check_advance_clearing', 'english'),
(28, 'Verify Advance Clearing', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a form advance clearing that verified by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to approve. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'verify_advance_clearing', 'english'),
(29, 'Approve Advance Clearing', '<p>Dear [NAME],</p>\r\n\r\n<p>Your form advance clearing&nbsp;request has already approved. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_advance_clearing', 'english'),
(30, 'Request Purchase Request Form', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a purchase request form that requested by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to check. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'request_purchase_request', 'english'),
(31, 'Check Purchase Request', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a purchase request form that checked by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to approve. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'check_purchase_request', 'english'),
(32, 'Approve Purchase Request', '<p>Dear [NAME],</p>\r\n\r\n<p>Your purchase request form has already approved. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_purchase_request', 'english'),
(33, 'Reject Purchase Request', '<p>Dear [NAME],</p>\r\n\r\n<p>Your purchase request form has been rejected. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'reject_purchase_request', 'english'),
(34, 'Request Payment Voucher Form', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a new payment purchase form&nbsp;that requested by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to make check. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'request_payment_voucher', 'english'),
(35, 'Check Payment Voucher Form', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a new payment voucher form&nbsp;that checked by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to verify. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'check_payment_voucher', 'english'),
(36, 'Verify Payment Voucher Form', '<p>Dear [NAME],</p>\r\n\r\n<p>You got a new payment voucher form&nbsp;that verified by the user&nbsp;&nbsp;[FIRST_NAME] [LAST_NAME] and transfers for you to approve. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'verify_payment_voucher', 'english'),
(37, 'Approve Payment Voucher Form', '<p>Dear [NAME],</p>\r\n\r\n<p>Your payment voucher form&nbsp;request has already approved. Thanks!</p>\r\n\r\n<p>Please access this link: [SITE_URL]<br />\r\n<br />\r\nYours,<br />\r\n[SITE_NAME]</p>\r\n', 'approve_payment_voucher', 'english');
